// In order to maxime the profit, the company cab service must know for each hour and each cluster what is the number of pick and then order them to set a profitable strategy
val useful_info = categories.select(hour($"date").alias("hour"), $"cluster").groupBy("hour", "cluster").agg(count("cluster").alias("count")).orderBy(desc("count"))
useful_info show

// For every hour what is the maximum number of pick-up over clusters ?
val hour_info = useful_info.groupBy("hour").agg(max("count").alias("count")).orderBy(desc("hour"))
hour_info.show()

// View
hour_info.createOrReplaceTempView("hour_info")

